We define a new general rule-based nonmonotonic framework which allows an exterl acyclic priority relation between rules to be interpreted in several ways. Several entailment semantics are defined via a constructive digraph, with one being given a declarative fixed-point characterisation as well. Each of these semantics satisfies Principle 1 of [Brewka and Eiter 1999]. The framework encompasses Default Logic [Reiter 1980], ground Answer Set Programming (ASP) [Baral 2003], and Defeasible Logic [Nute 1994].&#13;
				Defa lt Logic is provided with a new semantics which is ambiguity blocking, rather than the usual ambiguity propagating semantics. Also Reiterextensions&#13;
				are given a new fixed-point characterisation; and Lukaszewicz's [1990] m-extensions are given a much simpler construction and fixed-point characterisation.

Background: Physiotherapists generally accept that electrophysical agents (EPAs) should not be applied directly over, or in the vicinity of cancerous tumours or other maligncies. The idea that EPAs are contraindicated is based upon the theoretical, but rarely proven risk of stimulating malignt cell proliferation and thus tumour growth and/or dissemition. However, a growing body of literature suggests that some electromagnetic and physical energies may be beneficial for use in the treatment of cancerrelated or cancer treatment-related sequelae, and tumours.&#13;
				Objectives: The aim of this rrative review was to collate information on the state of knowledge regarding the application of EPAs in some typical clinical presentations in physiotherapy cancer care; understand whether there is evidence for using EPAs in physiotherapy cancer care; and, how planning might progress to further the evidence in this field.&#13;
				Major findings: Few EPAs have been specifically tested for the capacity to increase tumour growth or dissemition. Evidence exists for the use of some EPAs for symptom control and palliative magement of cancer-related or cancer treatment-related symptoms and side effects.&#13;
				Conclusions: Physiotherapists should reconsider the potential use of EPAs in cancer care. Further research will elucidate how best to utilize EPAs in this field of practice. Using some EPAs for tumour treatment could be considered.

