The Malaysian accounting profession is committed to promoting education that results in a strong ethical culture within accountants. However, some consider ethical training unproductive since trainees may have their ethical values formed pre-commencement. This paper investigates the impact of ethics instruction on fil year accounting students, the future accountants of Malaysia. &#13;
				85 fil year accounting students were given five ethical scerios, and asked what action they considered appropriate. They were then subject to two ethical training methodologies, a traditiol lecture/tutorial process and a group assignment. After a significant gap, students were re-presented with the ethical scerios and asked what action they now considered appropriate. In all five instances students offered a more ethical response the second time. Also, participants rated both training methods and their combined effect as effective. &#13;
				Results suggest there is benefit in including ethics teaching and indeed emphasising its importance in accountancy courses, if the profession's goal of ethical practitioners is to be achieved.

Fraud is a multi-billion dollar industry that continues to grow annually. Many organisations are poorly prepared to prevent and detect fraud. Fraud detection strategies are intended to quickly and efficiently identify fraudulent activities that circumvent preventative measures. In this paper we adopt a Design-Science methodological framework to develop a model for detection of vendor fraud based on alysis of patterns or sigtures identified in enterprise system audit trails.&#13;
				&#13;
				The concept is demonstrated be developing prototype software. Verification of the prototype is achieved by performing a series of experiments. Validation is achieved by independent reviews from auditing practitioners. Key findings of this study are: i) automating routine data alytics improves auditor productivity and reduces time taken to identify potential fraud, and ii) visualisations assist in promptly identifying potentially fraudulent user activities. The study makes the following contributions: i) a model for proactive fraud detection, ii) methods for visualising user activities in transaction data, iii) a stand-alone MCL-based prototype.

