Impaired integration of the body schema with motor processes may contribute to painful and/or&#13;
				restricted movement in chronic pain. Laterality judgment tasks assess this integration of the body&#13;
				schema with motor processes. The purpose of this study was to assess if patients with chronic whiplash&#13;
				associated disorders (WAD) are impaired on laterality judgment tasks. Accuracy (ACC) and reaction time&#13;
				(RT) for foot and neck laterality tasks were assessed in 64 (35 female) patients with chronic (&gt;6months)&#13;
				WAD and 24 (14 female) asymptomatic subjects. Pain characteristics, post-traumatic stress symptoms,&#13;
				cold pain thresholds (CPT) and pressure pain thresholds (PPT) were collected for patients with WAD. The&#13;
				effect of WAD and body part on laterality task performance was assessed. For patients with WAD, the&#13;
				correlations between neck task performance and pain characteristics, post-traumatic stress symptoms&#13;
				and pain thresholds were assessed. There was no effect of group on laterality performance. Subjects&#13;
				showed better RT (p &lt; 0.001) and ACC (p 젰.001) on the neck task in comparison to the foot task. There&#13;
				was a significant correlation between CPT and ACC (r 젰.33) and RT (r 젂0.33) on the neck laterality&#13;
				task in patients with WAD. Cervical spine PPT were significantly correlated with accuracy (r 젰.36) and&#13;
				RT (r 젰.29) in patients with WAD. These findings suggest that patients with chronic WAD are not&#13;
				impaired on neck or foot laterality judgment tasks. Laterality training is not indicated in the magement&#13;
				of chronic WAD.

Background: Providing ongoing family centred support is an integral part of childhood cancer care. For families living in regiol and remote areas, opportunities to receive specialist support are limited by the availability of health care professiols and accessibility, which is often reduced due to distance, time, cost and transport. The primary aim of this work is to investigate the cost-effectiveness of videotelephony to support regiol and remote families returning home for the first time with a child newly diagnosed with cancer&#13;
				Methods/design: We will recruit 162 paediatric oncology patients and their families to a single centre randomised controlled trial. Patients from regiol and remote areas, classified by Accessibility/Remoteness Index of Australia (ARIA+) greater than 0.2, will be randomised to a videotelephone support intervention or a usual support control group. Metropolitan families (ARIA+ = 0.2) will be recruited as an additiol usual support control group. Families allocated to the videotelephone support intervention will have access to usual support plus education, communication, counselling and monitoring with specialist multidiscipliry team members via a videotelephone service for a 12-week period following first discharge home. Families in the usual support control group will receive standard care i.e., specialist multidiscipliry team members provide support either face-to-face during inpatient stays, outpatient clinic visits or home visits, or via telephone for families who live far away from the hospital. The primary outcome measure is parental health related quality of life as measured using the Medical Outcome Survey (MOS) Short Form SF-12 measured at baseline, 4 weeks, 8 weeks and 12 weeks. The secondary outcome measures are: parental informatiol and emotiol support; parental perceived stress, parent reported patient quality of life and parent reported sibling quality of life, parental satisfaction with care, cost of providing improved support, health care utilisation and fincial burden for families.&#13;
				Discussion: This investigation will establish the feasibility, acceptability and cost-effectiveness of using videotelephony to improve the clinical and psychosocial support provided to regiol and remote paediatric oncology patients and their families.

Glutathione peroxidase and thioredoxin reductase are selenocysteine-dependent enzymes that protect against oxidative injury. This study examined the effects of dietary selenium on the activity of these two enzymes in rats, and investigated the ability of selenium to modulate myocardial function post ischemia-reperfusion. Male wistar rats were fed diets containing 0, 50, 240 and 1000 姯kg sodium selenite for 5 weeks. Langendorff perfused hearts isolated from these rats were subjected to 22.5 min global ischemia and 45 min reperfusion, with functiol recovery assessed. Liver samples were collected at the time of sacrifice, and heart and liver tissues assayed for thioredoxin reductase and glutathione peroxidase activity.&#13;
				&#13;
				Selenium deficiency reduced the activity of both glutathione peroxidase and thioredoxin reductase systemically. Hearts from selenium deficient animals were more susceptible to ischemia-reperfusion injury when compared to normal controls (38% recovery of rate pressure product (RPP) vs. 47% recovery of RPP). Selenium supplementation increased the endogenous activity of thioredoxin reductase and glutathione peroxidase and resulted in improved recovery of cardiac function post ischemia-reperfusion (57% recovery of RPP).&#13;
				&#13;
				Endogenous activity of glutathione peroxidase and thioredoxin reductase is dependent on an adequate supply of the micronutrient selenium. Reduced activity of these antioxidant enzymes is associated with significant reductions in myocardial function post ischemia-reperfusion.

Critical disability studies have shown that disability has been geographically and culturally defined and regulated by Western Governments. Thus, disability has history and context (Campbell 2008; Thomson 1997). This paper focuses on the impact these processes may have on people with disability in Sri Lanka.&#13;
				An underlying dilemma presented here concerns the relationship between philosophy and action. A critique of the universalist approach to disability governce could occur through a critical appraisal of globalisation. However, some writers would argue that a focus on globalisation is a distraction from a more pressing concern; the continued Eurocentricism of knowledge and the domition of the Global North in social policy, law reform and research (Alatas 2006; Connell 2007). I argue that the United tions delimits and denotes the kinds&#13;
				of bodies known as 'disabled' and this culture of knowledge&#13;
				production controls notions of difference.
